// // Page Component
import React, { useState } from 'react';
import Flashcard from '/Users/yerimsong/Documents/Spring2024/harbor/src/components/flashcard.js'; // Make sure to have the correct path

const flashcardsData = [
  { front: 'Front of Card 1', back: 'Back of Card 1' },
  // ...add as many flashcards as you like
];

const Page = () => {
  const [currentIndex, setCurrentIndex] = useState(0);

  // ...

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100">
      <div className="flex space-x-4 overflow-x-auto py-8">
        {flashcardsData.map((flashcard, index) => (
          <Flashcard
            key={index}
            frontContent={<div className="text-center">{flashcard.front}</div>}
            backContent={<div className="text-center">{flashcard.back}</div>}
            className={currentIndex === index ? 'opacity-100' : 'opacity-50'}
          />
        ))}
      </div>
      <div className="flex space-x-2 mt-4">
        {flashcardsData.map((_, index) => (
          <div
            key={index}
            className={`h-3 w-3 rounded-full ${currentIndex === index ? 'bg-black' : 'bg-gray-300'}`}
            onClick={() => setCurrentIndex(index)}
          ></div>
        ))}
      </div>
      {/* ... */}
    </div>
  );
};

export default Page;
